update-graph (Client: class ui-client-item)

Val : integer = 1;

begin

if the procedure-invocation that is the-running-procedure-for Client exists then
    return;

call gdd-setup-class-definition (graph-info);

conclude that this procedure-invocation is the-running-procedure-for Client;

repeat 
    wait for gdd-graph-wait ; 
    conclude that the val of 3d1 = the val of 3d1 + Val;
    call gdd-shift-icon (3d1, 0, Val);
    if the val of 3d1 > 49 then 
        Val = -1;
    if the val of 3d1 < 1 then 
        Val = 1;
end;

end

update-linear (Client: class ui-client-item)

Val : integer = 1;

begin

if the procedure-invocation that is the-running-procedure-for Client exists then
    return;

conclude that this procedure-invocation is the-running-procedure-for Client;
repeat 
  wait for gdd-linear-wait ; 
        conclude that the level of V1 = the level of v1 + Val;
        if the level of v1 > 99 then Val = -1; 
        if the level of v1 < 1 then Val = 1; 
    end;
end

update-meter (Client: class ui-client-item)

Val : integer = 1;

begin
    if the procedure-invocation that is the-running-procedure-for Client exists then
    return;

conclude that this procedure-invocation is the-running-procedure-for Client;
repeat 
  wait for gdd-meter-wait ; 
        conclude that the level of t1 = the level of t1 + Val;
         if the level of t1 > 99 then
            Val = -1;
         if the level of t1 < 1 then
            Val = 1;
    end;
end

update-amps (Client: class ui-client-item)
begin 

if the procedure-invocation that is the-running-procedure-for Client exists then
    return;

conclude that this procedure-invocation is the-running-procedure-for Client;

repeat 
    wait for gdd-dial2-wait ; 
    conclude that the AMPS of AMP1 = abs (100 * sin (the current subsecond real time / 10));
end;
end

update-dial (Client: class ui-client-item)

begin

if the procedure-invocation that is the-running-procedure-for Client exists then
    return;

conclude that this procedure-invocation is the-running-procedure-for Client;
repeat 
  wait for gdd-dial-wait ;
  conclude that the volts of p1 = the volts of p1 + 5;
  if the volts of p1 > 100 then
    conclude that the volts of p1 = 0;
  end;

end

gdd-counter (Obj : class object)
    Index : integer;
begin
    repeat
        for Index = 0 to 9 do
            conclude that the decode-value of Obj = Index;
            wait for 1 second;
        end;
        conclude that the decode-value of Obj = 0;  
        if there exists a gdd-7-segment-display Obj2 connected at the output of Obj then
            conclude that the decode-value of Obj2 = the decode-value of Obj2 + 1;   
    end;
end

gdd-decode (Obj : class object)
    Val : value = the decode-value of Obj;
begin
    conclude that the segment-a of Obj = 0; 
    conclude that the segment-b of Obj = 0; 
    conclude that the segment-c of Obj = 0;
    conclude that the segment-d of Obj = 0; 
    conclude that the segment-e of Obj = 0;
    conclude that the segment-f of Obj = 0;
    conclude that the segment-g of Obj = 0;
 
    case (Val) of
       0 :
           begin
                conclude that the segment-a of Obj = 1; 
                conclude that the segment-b of Obj = 1; 
                conclude that the segment-c of Obj = 1; 
                conclude that the segment-e of Obj = 1;
                conclude that the segment-f of Obj = 1;
                conclude that the segment-g of Obj = 1;
 
           end;
       1 :
           begin
              conclude that the segment-c of Obj = 1;
              conclude that the segment-f of Obj = 1; 
           end;
      2 :
           begin
              conclude that the segment-a of Obj = 1;
              conclude that the segment-c of Obj = 1; 
              conclude that the segment-d of Obj = 1;
              conclude that the segment-e of Obj = 1;
              conclude that the segment-g of Obj = 1; 
           end;
      3 :
           begin
              conclude that the segment-a of Obj = 1;
              conclude that the segment-c of Obj = 1; 
              conclude that the segment-d of Obj = 1;
              conclude that the segment-f of Obj = 1;
              conclude that the segment-g of Obj = 1; 
           end;
      4 :
           begin
              conclude that the segment-b of Obj = 1; 
              conclude that the segment-c of Obj = 1; 
              conclude that the segment-d of Obj = 1;
              conclude that the segment-f of Obj = 1; 
           end;
      5 :
           begin
              conclude that the segment-a of Obj = 1; 
              conclude that the segment-b of Obj = 1; 
              conclude that the segment-d of Obj = 1;
              conclude that the segment-f of Obj = 1; 
              conclude that the segment-g of Obj = 1; 
           end;
      6 :
           begin
              conclude that the segment-a of Obj = 1; 
              conclude that the segment-b of Obj = 1; 
              conclude that the segment-d of Obj = 1;
              conclude that the segment-e of Obj = 1; 
              conclude that the segment-f of Obj = 1; 
              conclude that the segment-g of Obj = 1; 
           end;
      7 :
           begin
              conclude that the segment-a of Obj = 1; 
              conclude that the segment-c of Obj = 1;  
              conclude that the segment-f of Obj = 1; 
           end; 
      8 :
           begin
              conclude that the segment-a of Obj = 1;
              conclude that the segment-b of Obj = 1; 
              conclude that the segment-c of Obj = 1; 
              conclude that the segment-d of Obj = 1;
              conclude that the segment-e of Obj = 1; 
              conclude that the segment-f of Obj = 1;
              conclude that the segment-g of Obj = 1; 
           end; 
      9 :
           begin
              conclude that the segment-a of Obj = 1;
              conclude that the segment-b of Obj = 1; 
              conclude that the segment-c of Obj = 1; 
              conclude that the segment-d of Obj = 1;
              conclude that the segment-f of Obj = 1; 
           end; 
       otherwise :
           begin
               {-- Do nothing --} 
           end; 
     end;

    start gdd-update (Obj);
end
